import History from "../components/Profile/History";
import {
	LayoutProfile,Profiles,ProfileDetails,TextDetail,ProfileText
} from './style'
const ProfileContainer = () => {
	return (
		<>
				<LayoutProfile>
				<Profiles>
					{/* <AvatarProfile /> */}
					<ProfileDetails>
						<ProfileText>
							<TextDetail>
							<AvatarProfile />
							<div style={{margin:'auto'}}>
									<p>Name</p>
							<p>Username</p>

							</div>

						</TextDetail>
						</ProfileText>
						<div style={{display:'flex',justifyContent:'center'}}>
							<hr style={{width:'80%'}}/>
						</div>
						<ProfileText>
							<History/>
						</ProfileText>						
					</ProfileDetails>
				</Profiles>
			</LayoutProfile>
		</>
	);
};
export default ProfileContainer;
